// Adding some colors. Define color schema by attritbute values. Use ColorBrewer for choosing 
function getColor(d) {
    return d > 7 ? '#800026' :
           d > 6  ? '#BD0026' :
           d > 5  ? '#E31A1C' :
           d > 4  ? '#FC4E2A' :
           d > 3  ? '#FD8D3C' :
           d > 2  ? '#FEB24C' :
           d > 1  ? '#FED976' :
                    '#FFEDA0';
}


// Method that we will use to update the control based on feature properties passed
// Show information when hover inside zone 
var info = L.control();

info.onAdd = function (map) {
    this._div = L.DomUtil.create('div', 'info'); // create a div with a class "info"
    this.update();
    return this._div;
};

info.update = function (props) {
    this._div.innerHTML = '<h4>Singapore Zone Population</h4>' +  (props ?
        '<b>' + props.Name + '</b><br />' + props[PARA].toFixed(3) + ' Log Number of people <br />' + props['price_psqm_median_condo'].toFixed(3) + ' Condo Price(PSQM) '
        : 'Hover over a zone');
};

info.addTo(map);

// Define the legend information to display
// The legend is attached to the control 
var legend = L.control({position: 'bottomright'});

legend.onAdd = function (map) {

    var div = L.DomUtil.create('div', 'info legend'),
        grades = [0, 1, 2, 3, 4, 5, 6, 7],
        labels = [];

    // loop through our density intervals and generate a label with a colored square for each interval
    for (var i = 0; i < grades.length; i++) {
        div.innerHTML +=
            '<i style="background:' + getColor(grades[i] + 1) + '"></i> ' +
            grades[i] + (grades[i + 1] ? '&ndash;' + grades[i + 1] + '<br>' : '+');
    }

    return div;
};

legend.addTo(map);


// Styling function for GeoJson layer so that the fillColor depends on the attributes value. Also adjusting the appearance a bit and adding a nice touch with dashed stroke
function style(feature) {
    return {
        fillColor: getColor(feature.info[PARA]),
        weight: 2,
        opacity: 1,
        color: 'white',
        dashArray: '3',
        fillOpacity: 0.7
    };
}

// Adding interactions
// Define event listener for layer mouseover event 
function highlightFeature(e) {
	//get access to the layer via e.target
    var layer = e.target;

    layer.setStyle({
        weight: 5,
        color: '#666',
        dashArray: '',
        fillOpacity: 0.7
    });

    if (!L.Browser.ie && !L.Browser.opera && !L.Browser.edge) {
        layer.bringToFront();
    }
	// Update the control when the user hovers over a zone
	info.update(layer.feature.info);
}

//Define event listener for mouseout event 
function resetHighlight(e) {
	//reset the layer style to its default zone
    geojson.resetStyle(e.target);
	// Update the control when the user hovers out a zone
	info.update();
}

//Define click event listener
function zoomToFeature(e) {
    map.fitBounds(e.target.getBounds());
}

// Use the onEachFeature option to add the listeners on our state layers:
function onEachFeature(feature, layer) {
    layer.on({
        mouseover: highlightFeature,
        mouseout: resetHighlight,
        click: zoomToFeature
    });
	

}

// Assign event layer to geojson layer 
geojson = L.geoJson(zones, {
    style: style,
    onEachFeature: onEachFeature
}).addTo(map);

var legend = L.control({position: 'bottomright'});
legend.onAdd = function (map) {
	var div = L.DomUtil.create('div', 'legend'),
	colors = ['rgba(74, 186, 185, 0.8)', '#BEF799'],
	labels = ['HDB', 'CONDO'];

	for (var i = 0; i < labels.length; i++) {
		div.innerHTML +=

            labels[i] + '<br>';
	}

	return div;
};
